      the user''s query.\n\n---Goal---\n\nGiven the query, list both high-level and
      low-level keywords. High-level keywords focus on overarching concepts or themes,
      while low-level keywords focus on specific entities, details, or concrete terms.\n\n---Instructions---\n\n-
      Output the keywords in JSON format.\n- The JSON should have two keys:\n  - \"high_level_keywords\"
      for overarching concepts or themes.\n  - \"low_level_keywords\" for specific
      entities or details.\n\n######################\n-Examples-\n######################\nExample
      1:\n\nQuery: \"How does international trade influence global economic stability?\"\n################\nOutput:\n{{\n  \"high_level_keywords\":
      [\"International trade\", \"Global economic stability\", \"Economic impact\"],\n  \"low_level_keywords\":
      [\"Trade agreements\", \"Tariffs\", \"Currency exchange\", \"Imports\", \"Exports\"]\n}}\n#############################\nExample
      2:\n\nQuery: \"What are the environmental consequences of deforestation on biodiversity?\"\n################\nOutput:\n{{\n  \"high_level_keywords\":
      [\"Environmental consequences\", \"Deforestation\", \"Biodiversity loss\"],\n  \"low_level_keywords\":
      [\"Species extinction\", \"Habitat destruction\", \"Carbon emissions\", \"Rainforest\",
      \"Ecosystem\"]\n}}\n#############################\nExample 3:\n\nQuery: \"What
      is the role of education in reducing poverty?\"\n################\nOutput:\n{{\n  \"high_level_keywords\":
      [\"Education\", \"Poverty reduction\", \"Socioeconomic development\"],\n  \"low_level_keywords\":
      [\"School access\", \"Literacy rates\", \"Job training\", \"Income inequality\"]\n}}\n#############################\n\n#############################\n-Real
      Data-\n######################\nQuery: pandas\n######################\nThe `Output`
      should be human text, not unicode characters. Keep the same language as `Query`.\nOutput:\n\n"}],
